import React from 'react';
import activities from './activities';


const index=()=>{
    return(
        <>
            <div className='About'>
                <h1>이현수</h1>
            </div>
            <div className='Career'>
                <h1>Career</h1>
                <h2>포스텍 영재 기업인 교육원 7기</h2>
                <h2>숭실대학교 소프트웨어학부</h2>
                <h3>2019년 글로벌미디어학부 입학</h3>
                <h3>2020년 소프트웨어학부 전과</h3>
                <h2>숭실대학교 Yourssu 서비스 기획 팀장</h2>
                <h3>2019.09~</h3>
            </div>
            <div className='Activities'>
                <Activities imgsrc="images/yourssu.jpg"/>

            </div>
        </>

    );
}


export default index;
